import React from 'react';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import { Divider } from '@material-ui/core';

const member = ["Trash", "Spam","1","2","3"];

class NestedList extends React.Component {
  render() {
      return(
     <div>     
    <List component="nav" style = {{width : '20%', position : 'fixed' , left : "37.3%", border: "1px",boxShadow: "1px 1px 1px 1px #888888", borderRadius:"4px", maxHeight:"20%", overflow:"scroll", overflowY:"hidden"}}>
     {member.map(row => (<ListItem style = {{textAlign : "center"}} button>
      <ListItemText primary = {`${row}`}/>
      <divider/>
    </ListItem>))}
  </List>
  </div>)
}
}

export default NestedList;
